import { react, Fragment } from "react";
import { Container, Row, Col, Image } from "react-bootstrap";

const Profile = (user) => {
  return (
    <Fragment>



    <ul>
      {user.users.map(item => (
        <li >
            {item}
        </li>
      ))}
    </ul>
  </Fragment>
  );
};

export default Profile;
